import {
    createBrowserRouter,
    //Outlet,
    RouterProvider,
} from "react-router-dom";
import Login from "./pages/login/Login";
import Register from "./pages/register/Register";

const router = createBrowserRouter([
    {
        path: "/",
        element: <Login />
    },
    {
        path: "/register",
        element: <Register />
    }
]);

function App() {
    return (
        <RouterProvider router={router} />
    );
}

export default App;
